import React, { Component } from 'react';

class Product extends Component {

	constructor(props) {
		super(props);
	}

	render() {
		return (
			<>
				<p>Each {this.props.name} costs ${this.props.price}</p>
				<p>{props.children}</p>
				<hr/>
			</>
		)
	}
}

export default Product;
